import logo from './logo.svg';
import './App.css';

const name = "Tanya Goel";
const day = new Date();
var hr = day.getHours();
if (hr >= 0 && hr < 12) {
  document.write("Good Morning!");
} else if (hr == 12) {
  document.write("Good Noon!");
} else if (hr >= 12 && hr <= 17) {
  document.write("Good Afternoon!");
} else {
  document.write("Good Evening!");
}
